module.exports=function(t){t.config(function(t,e,l){e.otherwise("/login"),t.state("login",{url:"/login",templateUrl:"../partials/login.html"}).state("logout",{url:"/logout",controller:function(t,e){delete t.username,delete t.token,e.go("login")}}).state("dashboard",{url:"/dashboard",templateUrl:"../partials/dashboard.html",controller:"DashboardCtrl"}).state("game",{url:"/game/:gameId",templateUrl:"../partials/game.html",controller:"GameCtrl"}),l.interceptors.push(require("../services/httpInterceptor"))})};